package com.rendonsoft.testtotalplay.features.home.framework.diimport com.rendonsoft.testtotalplay.features.home.data.CountryRepositoryimport com.rendonsoft.testtotalplay.features.home.data.dataSource.CountryDataSourceimport com.rendonsoft.testtotalplay.features.home.framework.data.implementation.dataSource.CountryDataSourceImplimport com.rendonsoft.testtotalplay.features.home.framework.data.implementation.mapper.CountryMapperimport com.rendonsoft.testtotalplay.features.home.framework.presentation.viewModel.CountryViewModelimport com.rendonsoft.testtotalplay.features.home.usescases.GetCountryAllUsesCaseimport com.rendonsoft.testtotalplay.utils.network.RetrofitCustomimport org.koin.androidx.viewmodel.dsl.viewModelimport org.koin.dsl.moduleval homeModule = module {    factory {        RetrofitCustom()    }    single {        CountryMapper()    }    single<CountryDataSource> {        CountryDataSourceImpl(get(), get())    }    single {        CountryRepository(get())    }    single {        GetCountryAllUsesCase(get())    }    viewModel {        CountryViewModel(get())    }}